import React, {useState} from 'react'
import {MyContext} from "./Context";
let Tutors = ()=>{

    const [data, setData] = useState({isLoaded: false});
    let wayToApi = "http://localhost:3001/select%20*%20from%20tutors";
    if (!data.isLoaded){
        fetch(wayToApi).then(
            (reposnse)=>{
                reposnse.json().then((json)=>{
                    let newState = json;
                    console.log(json)
                    newState.isLoaded = true;
                    setData(newState);
                })
            },
            (reject)=>{
                console.log(reject)
            }
        )
        return <div>Loading</div>
    }
    else {
        let localData = {...data};
        delete localData.isLoaded;
        return <div>
            {JSON.stringify(data)}
        </div>

    }

}
let reportStyle = {
    display: "inline-block",
    width: "15%",
    borderBottom:"1px solid grey",
    paddingTop:"1%"

}
export default Tutors
